(18, 17, 'Frauds Cheating Cases Investigation', 'upload/services/9207ee359d.jpg', '<p>In most of the corporate firms or government organizations, cheating or fraud cases are common. It is the thing that provides loss to the financial portion of that institution where frauds are done. Mostly, it happens with the commercial offices which are located in a high profile area and where large numbers of employees are working. If large numbers of employees are working in an organization, it is possible for a person to perform frauds and it is not easy for the organization to detect those activities.<br />\r\n<br />\r\nSince, most of the corporate and financial institutions are located in the metro cities; large number of frauds and cheating cases are happening in these cities. We are working with the clients who are located in different parts of the country and we are ready to solve all kinds of cases which are related to this context. We are dealing with the clients with our team of experts who are working for us from a long time and are ready to provide fruitful results to us. We do not commit for time limit to our clients in advance as we have to judge the complexity of the case which we are going to solve. However, we can assure that we will provide positive result to them soon. Most of the financial institutions which are located in Delhi or capital region areas are our clients and we provide time to time services to them.</p>', 'upload/services/a3f7f0d190.jpg', '<p>\r\nTo detect the frauds in natural manner, we work in a team and that team \r\nworks through a chain of people in a planned manner. This is the reason \r\nbecause of which it is possible for us to get the positive results as \r\nsoon as possible. We are also running on the latest software and devices\r\n because of which fraud detection is possible.\r\n\r\n<br></p>', NULL, NULL),
(16, 17, 'Loan and Finances Investigation', 'upload/services/e97f267300.jpg', '<p>Today due to difficult economic condition, taking financial assistance, loans and debts from money lending firms, financial institutions and individuals are becoming a norm of life style. More and more people are opting for such financial assistance and loan to fulfill their daily needs and requirements and to make their life more comfortable. However, due to the increasing rate of frauds and crime it is becoming quite difficult for lending parties to recover the loans and finances without any issue.<br />\r\n<br />\r\nFinancial institutions and lending agencies are facing problem in recovering the loan amount from the borrower. Moreover, people may also abscond sometime and the organizations may file an Insolvency Petition or IP. So, in such cases lending agencies may approach Indian Detective Agency to unveil the motive behind the money dodging.</p>', 'upload/services/75882f1aa1.jpg', '<p>\r\nWe at IDA offer services to financial institutions and lending agencies \r\nand help them to recover the amount without any hassle. We offer \r\nservices for financial \r\n\r\n\r\nfrauds.\r\nWe help the financial institutions and banks \r\n\r\n</p><p>\r\n\r\n\r\nto trace the loan defaulter and make the organization aware about them. \r\nWe have solved many financial frauds cases and traced many loan \r\ndefaulters who have abscond with the loan money. We put all our efforts \r\nand help the financial institutions to recover the money from the \r\nborrower. The case of loan evading is quite higher in India and it is \r\nalways better to hire our services if you donâ€™t want to become the next \r\nvictim of such defaulters. \r\n\r\n<br></p>', NULL, NULL),
(17, 17, 'Theft Investigation Services', 'upload/services/dafa0534d9.jpg', '<p>Theft as well as burglary are the most common and problematic issues in present day society. People are finding ways to prevent such issues and to get rid from theft and burglary occurring in the society at a rapid pace. This type of issue may even adversely affect all the sphere and levels of life. Today in this world where anti-socialism is increasing significantly, everyone needs to be careful and vigilantly enough about their valuable items and possessions. We at Indian Detective Agency offer exceptional investigation services to our esteemed clients so as to get rid from these types of issues. Our theft investigation services assist our clients in investigations when theft occur and easily find out the culprit behind the burglary.<br />\r\n<br />\r\nWe are well equipped with all latest and sophisticated technology that helps our investigation process a bit faster and easier. With our vast knowledge and experience in the field we ensure our clients to offer satisfied report about the investigation. We have team of expert investigators especially for theft and burglary cases. Besides, investigating theft cases they also offer suggestions and advices to protect the valuable possessions and items. We investigate all the assigned cases with complete privacy and confidentiality of the client. We ensure our clients that their confidential information will only be distribute to the right hands so that the confidentiality of the clients is persist. We never disclose or unveil the details of our clients to any unauthorized individual. Besides, the report we generate at the end of the investigation is only handed over to correct person.</p>', 'upload/services/da2cf2d267.jpg', '<p>\r\nThe technology we use for investigating theft cases is based on \r\ninnovative and latest technologies that is mainly tested and tried to \r\nsolve theft and burglary cases. The cases assigned to our investigators \r\nare carried out with complete perfection so as to make sure that our \r\nclients are served with complete satisfaction. We assist our clients to \r\nget clues of the cases that make the investigation process easier and \r\nfaster and we easily locate the culprit behind the scene. <br>\r\n                        <br>\r\n                        Indian Detective Agency has several expert \r\ninvestigators who are competent enough to deal with burglary and theft \r\ncases. We have already solved several theft cases and satisfied our \r\nclients with well written report about the investigation. IDA is a \r\ncomplete setup in terms of technical instruments, latest technology and \r\nhuman power to deal with all types of theft cases. So, entrust you theft\r\n case to us to experience our services.\r\n\r\n<br></p>', NULL, NULL),
(15, 17, 'Personal bodyguard services in India', 'upload/services/ffd1c3b832.jpg', '<p>The need for personal bodyguard services arises when a menace is imminent. We at Indian Detective Agency Pvt. Ltd, with our highly trained and specialized executives, ensures to provide all round protection, safety and personal bodyguard services to our esteemed clients and their families, whether at their homes, working places or while travelling. IDAPL is the leading and eminent provider of personal bodyguard services in India and abroad. Being a prominent service provider, we are passionately involved in offering reliable and effective&nbsp; personal bodyguard services in India. Our personal bodyguard services cater the ever-growing needs of protection of our clients successfully. All our professional bodyguards are highly trained and equipped with modern equipments and technologies so as to ensure that complete protection and security is offered whenever demanded by our clients. Our bodyguards are not only restricted in providing protection services to families and individuals, but they have also marked remarkable impression in providing personal bodyguard services to celebrities, VVIPs and also for all occasions.</p>', 'upload/services/d0adf580fc.jpg', '<p>\r\nWith its efforts and dedication towards excellence, IDAPL has confirmed \r\nits standing amongst the top detective agencies of India providing \r\nrevolutionary personal bodyguard services in India beyond expectations. \r\nToday IDAPL has become the most reputed and respected service provider \r\nof India, due to the unique training exercised by our executives \r\nregularly that helps them surpass the expectations of our clients by \r\ndelivering quality services. IDAPL is reckoned as the modern detective \r\nagency with highly trained and competent executives having decades of \r\nhands-on experience in providing personal bodyguard services in India. \r\nThis enables the company to offer inspirational bodyguard services to \r\nits clients always by keeping the needs of the clients in mind. <br>\r\n                            <br>\r\n                            Our professional executives are competent \r\nenough to guarantee a round the clock services, a short time of \r\nappearance, if the situation demands for. We are a professional \r\ndetective agency and work in adherence to the rules of Indian law and in\r\n co-operation with government authorities and polices that help us to \r\ndeliver services without hampering the laws set by Indian government. \r\nAll the services offered by our executives are designed on the basis of \r\nrisk analysis that helps our executives to recognize the best possible \r\nway of providing personal bodyguard services in accordance to the set \r\ntenets. Personal bodyguard services offered by us can be latent; however\r\n it can be activated if situation demands. So, respire with a feeling of\r\n security and safety and concentrate on your daily activities with our \r\npersonal bodyguard services in India.\r\n\r\n<br></p>', NULL, NULL),
(13, 18, 'HANDWRITING VERIFICATION SERVICES', 'upload/services/09e4ffcf13.jpg', '<p>Another commonly known method in order to detect the truth behind the unlawful activities besides Fingerprint Verification is the process of Handwriting Verification. It is the method, which is used by the investigation company to verify documents to check if they are authentic or not. Investigation Company hires expert people who are able to verify the handwriting written on the paper available at the crime spot in a better way.<br />\r\n<br />\r\nHandwriting Verification is done in the case of any fraud signature or in any kind of fraud documents. IDA can solve this problem by verifying the documents with the help of Handwriting experts. They examine any kind of fraudulent documents, which in turn help them to solve the case as soon as possible.<br />\r\n<br />\r\nAt the arena of Globalization, it is easy to form the fraudulent documents by copying the handwriting of any individual. Therefore, there are more chances of cheating in any field mainly in the business field because of more competition between various companies.<br />\r\n&nbsp;</p>', 'upload/services/80b10ed9d3.jpg', '<p>\r\nEvery company hires the handwriting experts in order to protect the \r\ncompany from any fraudulent documents. Crimes that arise due to the \r\nfraud handwriting are as follows: firstly, any one can put fraud \r\nsignature on the cheques and withdraw a large amount of money from the \r\nbank. Secondly, one can put fraud signature at the time of any agreement\r\n or at the time of any contract too.  All these things are criminal \r\nactivities and are punishable. <br>\r\n                        \r\n\r\n<br></p>', NULL, NULL),
(14, 18, 'Fingerprint Verification', 'upload/services/aaf91e9858.jpg', '<p>A Fingerprint Verification machine is a kind of modern device that is usually used by many reputed organizations to verify the identity of a particular person. By using this device, the fingerprint of a particular individual can be authenticated and compared with already stored fingerprint in the database. These kinds of machines are normally used in public buildings, computer security area and other sensitive organizations. For manufacturing this kind of machine different kind of modern technologies are used. In this contemporary world, due to terrorist activities, most of the organizations are using this kind of device for verification.</p>', 'upload/services/98aa08d859.jpg', '<p>\r\nWe at Indian Detectives Agency use the best technology to verify oneâ€™s \r\nfingerprints to get the most accurate result. Stated below are the some \r\nimportant benefits/advantages of using Fingerprint Verification. <br>\r\n                        <br>\r\n                        1.	A Fingerprint Verification device comes with \r\nvarious unique features. These unique features help to recognize as well\r\n as compare live fingerprints with stored fingerprints. As you know \r\nthat, the fine ridges in the fingers normally create a unique design, \r\nwhich differentiate all the fingerprints from each other. This is the \r\nreason why everyone has different fingerprint pattern. <br>\r\n                        <br>\r\n                        2.	This type of device is having a sensor motion\r\n that catches all the fingerprints instantly and compared with stored \r\ndatabase. Its fast functioning makes it a very useful tool to \r\nauthenticate a particular individual. <br>\r\n                        <br>\r\n                        3.	These kinds of devices are widely used at the\r\n airports. Therefore, if a criminal person tries to enter in a \r\nparticular country then these devices instantly recognize the person. <br>\r\n                        <br>\r\n                        4.	A Fingerprint Verification machine or device \r\nis connected with computer lab wherein the entire fingerprints database \r\nhas been stored. Therefore, it is very helpful to identify any wrong \r\nperson.<br>\r\n                        <br>\r\n                        5.	Almost all the sensitive organizations are \r\nusing this type of devices in order to protect themselves. <br>\r\n                        <br>\r\n                        6.	You can never find any kind of fault while \r\nusing this kind of device as all the fingerprints of people is \r\nsurprisingly different from each other.\r\n\r\n<br></p>', NULL, NULL),
(19, 17, 'Pre/Post Employment Verification', 'upload/services/e51f9267ab.jpg', '<p>To know the employment history of an applicant is extremely important for the organization before hiring them. Overlooking the significance of background checks may damage the reputation of the company adversely. Besides, it is also important for the organization to conduct post employment checks so as to keep a close eye on the activities of the present employees within the organization. So, considering this fact we at Indian Detective Agency help our esteemed clients to conduct both Pre/Post employment verifications. We help them to gather relevant information and details about the present employees and applicants by conducting detailed checks. Pre/Post Employment Verification make our clients aware about the past and background of the applicant and activities of the employees within the organization. Therefore, it becomes easier for our clients to take informative and correct decisions to make business flourish.</p>', 'upload/services/771443d53c.jpg', '<p>\r\nThrough pre employment verification our clients will come to know about \r\npast employment and background of the applicant and they can easily make\r\n out whether or not it is worthwhile to hire the application for the \r\norganization. According to a survey about 60% of the applicants make \r\nfalse C.V to obtain the desired designation in the organization. This \r\ntype of resume is very harmful and provides false information about the \r\napplication. With our quality pre employment verification services you \r\ncan easily find out the edits made in the CV and also we make the hiring\r\n process for the management accurate and smooth. \r\n\r\n<br></p>', NULL, NULL),
