(21, 16, 'FINANCIAL FRAUD', 'upload/services/d55eba57ab.jpg', '<p>We also provides services for financial frauds in the financial institution as well as the Banks. We get traced to those loan defaulter as per the clients requirement. We have done lot of cases of tracing of defaulters who has run away with clients money. We get hold those person as well as firm and our clients recover the money from them. This is new trend started by the insurance company to verify the claims through the independent agency because in past their were lot of fraud has been exposed about the insurance company personnel and insurer to make a fake claims. We have done lot of cases in past , we found lot of&nbsp; the claimant claims the money from insurance company on fraud documents of death certificate or so.</p>', 'upload/services/29ae80b048.jpg', '<p>\r\nIndian Detective Agency Pvt. Ltd. exclusively \r\nprovides  this services to his clients on theft. Our experienced team \r\nworks on the issue  immediately and catch hold of culprit in short time.\r\n Most of the cases we found  either the person is known to them or \r\ninsiders are involved. In few cases we  have made the culprit revealed \r\nof his/her crime and recovered the goods from  them\r\n\r\n\r\nMany a times,  spurious products with your brand \r\nname and trademark enter the market. These  products enjoy your market \r\nshare and reduce your profit margin to a  considerable extent. These \r\npractices are difficult to detect as trading occurs  in distant places \r\nand across geographical boundaries. We co-ordinate our  investigative \r\nactivities across several geographic locations to detect,  identify, \r\ncurtail and prevent the business in counterfeit products and  \r\ninfringement of trademarks. Indian Detective Agency Pvt. Ltd. Provides \r\nservices to his  client to check and catch hold of the organization who \r\nmake the duplicate  products and reduce your profit margin. \r\n\r\n<br></p>', NULL, NULL),
(22, 16, 'Divorce Case Investigation Services', 'upload/services/b82640bcfe.jpg', '<p>We at Indian Detectives Agency have a special unit for handling Divorce Case Investigation. This unit consists of experts who very well understand the seriousness and emotions that are involved with divorce cases and so they work accordingly ensuring that the investigation is carried out in the best possible way.<br />\r\n<br />\r\nDivorce case Investigation unlike other investigations involves lot of emotions and is excessively sensitive in comparison to other cases. They become more sensitive when they involve child custody issue. Our team of experts carry out the entire investigation ensuring that no detail is left and all the information is gathered along with proper evidences. We carry out researches on Background, asset evaluation is done and other researches based on the activities of the target.<br />\r\n<br />\r\nWe provide relevant evidences that can help your case and make it all the more strong in the court. We use all kinds of latest technologies to provide our customers with the best quality evidences. Our professional and trained experts carry out these investigations in the best possible way.</p>', 'upload/services/d621476dff.jpg', '<p>\r\nDuring legal processes of divorce it is very important for both parties \r\nto provide evidences based on which the judgement is made. Often people \r\nfail to gather all the information due to lack of resources. However now\r\n they need not worry as they can hire us for this task. We will gather \r\nall the required information for them so that they can provide all these\r\n evidences in the court. For people who think that they should get the \r\ncustody of their child as their spouse is not fit for handling the \r\nchild, we can help them gather evidences for the same by carrying out \r\nstudy on the financial status, character screening, behavioural \r\ninvestigation etc.<br>\r\n                        <br>\r\n                        The charges that we charge are very less as \r\ncompared to the outstanding services that we provide. Our experts work \r\nday and night to gather all the information for their clients.\r\n\r\n<br></p>', NULL, NULL),
(23, 16, 'Love Affair Investigation', 'upload/services/cde45effb6.jpg', '<p>Almost everyone is this world enjoy the real beauty of love and you might be one of them. But, it is quite painful when you come to know that your partner is having a love affair with someone else. So, in such situation you must hire our Love Affair Investigation services to confirm or find out whether or not the person is having love affair with another person. We at Indian Detective Agency offer Love Affair Investigation under the written authority of Parents. Once the case is entrusted to us we shadow the suspect person to confirm and find out whether or not the suspect is having love affair with anyone. We trace and watch each movement, meetings and contacts of the suspect without letting them know about the investigation. Our expert and trained investigators put all their efforts to procure evidences in the form of video-graphs and photos.</p>', 'upload/services/f6914184c7.jpg', '<p>\r\n</p><p>Love Affair Investigation offered by Indian Detective Agency help our\r\n clients to check the love affair of their partner and kids \r\nprofessionally. We offer investigation services as per the requirements \r\nof our clients. We check all the movements of the suspect, even when \r\nthey are out for shopping. Our investigators also check the personnel \r\nbreach of conduct, loyalty and trust of the suspect. </p>\r\n                      <p>At the end of the investigation we provide a \r\nwell written report about the investigation and also offer you relevant \r\nadvices to solve the issue in well manner. Though we are headquartered \r\nin Delhi, but we offer our quality investigation services across the \r\nnation and we have solved several cases related to fidelity checks and \r\nlove affair. <br>\r\n                        <br>\r\n                        To check the loyalty and faith of the partner \r\ntoward you is not easy and possible. You canâ€™t watch every movement of \r\nyour partner by your own. For this you will require assistance of \r\nprofessionals who have expertise in the field. So, for love affair \r\ninvestigation you may trust on our services. </p>\r\n                      <p>Indian Detective Agency is the name on which \r\nyou may trust in terms of quality investigation services. We offer very \r\nhigh-tech, reliable and fast love affair investigation services. We put \r\nall our efforts to solve the case professional and offer you clear \r\npicture of the case with out evidences in the form of video and photos. \r\nMost importantly, all out investigation services are quite affordable \r\nand you can check the loyalty of your partner without making any hole in\r\n your pocket</p>\r\n\r\n<br><p></p>', NULL, NULL),
